import React, { Component } from 'react'

class City extends Component {
    state = {
        id: null
    }
    componentDidMount(){
        let id = this.props.match.params.city_id;
        this.setState({
            id: id
        })
    }
    render() {
        return (
            <div className="container">
                <h4>route param</h4>
            </div>
        )
    }
}

export default City;
